import Link from "next/link";

const LandingHeader = () => (
  <div>
    <h1 className="title">Woo Young Choi</h1>
    <p>I build things for the web.</p>
    <style jsx>
      {`
        .title {
          color: #00ace6;
          font-family: "Georgia, serif";
          font-size: 20px;
          margin-left: auto;
          margin-right: auto;
          vertical-align: middle;
          text-decoration: none;
        }
      `}
    </style>
  </div>
);

export default LandingHeader;
